import React from 'react';

const Card = (props) => {

    const {
        name,
        manaCost,
        type,
        text,
        flavor,
        imageUrl
    } = props;

    return (
        <div className="Card">
            { name } - { manaCost } <br />
            { type } <br />
            { text } <br />
            { flavor } <br />
            <img src={ imageUrl } />
        </div>
    )
}

export default Card;
